def fun_getaverage(s):
    x=s.split(",")
    a=0
    count=0
    for i in range(len(x)):
        if (x[i].isnumeric()):
            a+=int(x[i])
            count+=1
        else:
            continue
    if a==0:
        return 0
    else:
        return a/count
